import React from 'react'
import MainLogo from '../assets/images/MYtineraryLogo.png';
import ''
class Main extends React.Component {
    render () {
        return (
            <div className="Main">
                <img src={MainLogo} className="Main-logo" alt="MYtinerary Logo" />
                <h5>Find your perfect trip, designed by insiders <br></br> 
                    who know and love their cities.</h5>
            </div>
        );
    }
  }

  export default Main
